import React from 'react';

const Contact = () => {
    return(
        <>
       <div className="my-5">
           <h1 className="text-center">Contact us</h1>
       </div>
       <div className="container contact_div">
           <div className="row">
               <div className="col-md-6 "></div>
           </div>
       </div>
        </>
    )
   
}
export default Contact;
